import React from 'react'

const Header = () => {
    const headerNav = [
        { display: 'Home', link: '/'},
        { display: 'Movies', link: '/movies'},
        { display: 'Tv Series', link: '/tvseries'},
    ]
    return (
        <div>
        Header
        </div>
    )
}

export default Header
